mapper.delete:

delete from kh_jld
where jldbh = #{jldbh,jdbcType=VARCHAR}
  and gsdwbm = #{gsdwbm,jdbcType=VARCHAR}

mapper.select:

select jldbh, gsdwbm, jshh, yhbh, jlddz, jldmc, jldcblx, jldlx, yslx, jldzt, dqbm, 
yysl, jldqyrq, cjsj, czsj
from kh_jld
where jldbh = #{jldbh,jdbcType=VARCHAR}
  and gsdwbm = #{gsdwbm,jdbcType=VARCHAR}
